I think of spans as tags, I don't have a lot of experience with them so this will be brief and incomplete. My main use case for tags is grouping structually unrelated code that has a common theme such as timing or system type. The examples for me are Startup systems Yearly or montly systems in my stratergy games Related ui or input handling You can use as many spans as you want. Now lets look at the syntax to use a span inside a fuction. You need code that looks like this let span = span!(Level::DEBUG, "start");
let _guard = span.enter(); Spans only apply when the logging level is set at it or above. Note _guard is there to stop the variable being dropped immediately. The underscore is to stop unused errors as its drop behaviour is what really makes it work! While _guard is valid(undropped) the span is entered. While span is valid the span is created. There are shorthands for all logging levels, such as trace_span! You cannot combine the span(/* snip*/).enter into one line as entering a span and creating are distinct things. A span is only created once while a span can be entered many times. Entering and exiting spans is stuff I don't have much idea about beyond the scope this tutorial(mostly async stuff). Spans exit when the variable holding the enter is dropped in this example the _guard spans close when the span variable is dropped. We can use square brackets to filter by span filter: "warn,test_spiral=trace,test_spiral::spammy=info,test_spiral[start]=trace" Now for the entire code use bevy::{log::LogPlugin, prelude::*};
